import React from 'react';
import '../Main.css';
import { CharacterPart } from './components/CharacterPart.js';

const Main = ({ Reminder, Generator, Donate }) => {
  return (
    <main id="generator" className= "main-inner">
    <Reminder />
    <Generator CharacterPart = {CharacterPart}/>
    <Donate />
    </main>)
};

export {Main};
